import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Home/Navbar/Navbar";
import TopPageContent from "./components/Home/TopPageContent";
import DownPageContent from "./components/Home/DownPageContent";
import Footer from "./components/Home/Footer";
import { Component } from "react";

class App extends Component {
  render() {
    return (
        <div className="App">
          <Navbar />
          <section class="hero is-medium is-link">
            <p class="title">
              <TopPageContent />
            </p>
          </section>
          <DownPageContent />
          <Footer />
        </div>
    );
  }
}

export default App;
